import React, { Fragment } from 'react';
import ReactDOM from 'react-dom';
import App from "./App";
import  "./index.css";
import {BrowserRouter} from "react-router-dom";

ReactDOM.render(
    <fragment>
    <BrowserRouter>
    <App/>
    </BrowserRouter>
    </fragment>
,document.getElementById("root"));
